import React from "react";

function App() {
  const [user, setUser] = React.useState([]);

  const fetchData = () => {
    fetch(`"https://randomuser.me/api/?results=1"`).then((response) =>
      response.json()
    );
  };

  React.useEffect(() => {
    fetchData();
  }, []);

  return Object.keys(user).length > 0 ? (
    <div style={{ padding: "40px" }}>
      <h1>Customer data</h1>
    </div>
  ) : (
    <h1>Data pending...</h1>
  );
}

export default App;
